import React from 'react';
const Question=({question,title}) =>{
    return <h3 className="card-title">
        {question.id}
    <br></br>
    {question.author}<br></br><br></br>
    {question.title}<br></br><br></br>
    {question.description}<br></br><br></br>
    {question.imageurl}<br></br><br></br>
    {question.publishdate}<br></br><br></br>



    </h3>
};

export default Question;
